                                type="tel"
                                name="number"
                                placeholder="CVC"
                                minLength="16" maxLength="16"
                                onChange={handleInputChange}
                                 onFocus={handleInputFocus}
                            />
                            </form>
                    </div>
            </div>
        </div>
    )
}

export default CarteBleu;
